import React from "react";
import Movies from "../Movies/Movies";
import People from "../People/People";
import Tvshows from "../Tvshows/Tvshows";
// import axios from "axios";
// import { useEffect, useState } from "react";
// import styles from "./Home.module.scss";

import { Link } from "react-router-dom";


export default function Home() {
  // const [trendingItems, setTrendingItems] = useState([]);
  // useEffect(() => {
  //   getTrendingItems();
  // }, []);

  // let getTrendingItems = async () => {
  //   let { data } = await axios.get(
  //     "https://api.themoviedb.org/3/trending/all/day?api_key=df0aad8d17f69e36bdd1a3de0d77194f"
  //   );
  //   setTrendingItems(data.results);
  // };


  const [trendingMovies, setTrendingMovies] = useState([]);
  const [trendingPerson, setTrendingPerson] = useState([]);
  const [trendingTvshows, setTrendingTvshows] = useState([]);
  return (
    <>
     
      {/* <div className="row my-3 py-5">
        <div className="col-md-4">
          <div className={`${styles.bordr} w-25 mb-4`}> </div>
          <h3>Trending</h3>
          <h3>Movies</h3>
          <h3>To watch Now</h3>
          <span className="text-muted">most watched movies by day</span>
          <div className={`${styles.bordr} w-100 mt-4`}></div>
        </div>
        {trendingItems.map((item, index) => (
          <div key={index} className="col-md-2">
            <div className="item">
              <img
                className="w-100"
                src={`https://image.tmdb.org/t/p/original${item.poster_path}`}
                alt=""
              />
              <h6>
                {item.title}
                {item.name}
              </h6>
            </div>
          </div>
        ))}
      </div> */}




      <Movies />
      <Tvshows />
      <People />

      <div className="row py-4 gy-3">
        <div className="col-md-4">
          <div className="bordr w-25 mb-3"> </div>
          <h3>Trending</h3>
          <h3>Movies</h3>
          <h3>To watch Now</h3>
          <p className="text-muted mb-3">most watched movies by day</p>
          <div className="bordr "></div>
        </div>
        {trendingMovies.map((item, index) => (
          <div className="col-md-2" key={index}>
            <Link
              className="nav-link"
              to={`/details/${item.id}/${item.media_type}`}
            >
              <div className="item position-relative">
                <img
                  className="w-100"
                  src={`https://image.tmdb.org/t/p/w500/` + item.poster_path}
                  alt=""
                />
                <h2 className="h6">{item.title}</h2>
                <span className="position-absolute top-0 end-0 p-2 bg-info">
                  {item.vote_average.toFixed(1)}
                </span>
              </div>
            </Link>
          </div>
        ))}
      </div>
      <div className="row py-4 gy-3">
        <div className="col-md-4">
          <div className="bordr w-25 mb-3"> </div>
          <h3>Trending</h3>
          <h3>Tv</h3>
          <h3>To watch Now</h3>
          <p className="text-muted mb-3">most watched TvShows by day</p>
          <div className="bordr "></div>
        </div>
        {trendingTvshows.slice(0, 10).map((item, index) => (
          <div className="col-md-2" key={index}>
            <Link
              className="nav-link"
              to={`/details/${item.id}/${item.media_type}`}
            >
              <div className="item position-relative">
                <img
                  className="w-100"
                  src={`https://image.tmdb.org/t/p/w500/` + item.poster_path}
                  alt=""
                />
                <h2 className="h6">{item.name}</h2>
                <span className="position-absolute top-0 end-0 p-2 bg-info">
                  {item.vote_average.toFixed(1)}
                </span>
              </div>
            </Link>
          </div>
        ))}
      </div>

      <div className="row py-4 gy-3">
        <div className="col-md-4">
          <div className="bordr w-25 mb-3"> </div>
          <h3>Trending</h3>
          <h3>People</h3>
          <h3>To watch Now</h3>
          <p className="text-muted mb-3">most watched People by day</p>
          <div className="bordr "></div>
        </div>
        {trendingPerson.slice(0, 10).map((item, index) => (
          <div className="col-md-2" key={index}>
            <Link
              className="nav-link"
              to={`/details/${item.id}/${item.media_type}`}
            >
              <div className="item position-relative">
                <img
                  className="w-100"
                  src={`https://image.tmdb.org/t/p/w500` + item.profile_path}
                  alt=""
                />
                <h2 className="h6">
                  {item.name}
                  {item.title}
                </h2>
                {/* <span className="position-absolute top-0 end-0 p-2 bg-info">
                {item.vote_average.toFixed(1)}
              </span> */}
              </div>
            </Link>
          </div>
        ))}
      </div>
    </>
  );
}
